import React from 'react'
import toggleDecorator from '../decorators/toggleDecorator'
import addArticleIcon from '../create-article.svg'

const ToggleCreate = ({ toggleAnimation, padding, transformL, transformR, opacity } ) => {

	const styles = {transition: 'all .3s ease-out'}

	return(

		<button onClick={toggleAnimation} style={{padding: padding, ...styles}}>

		  <div style={{transform:transformL, ...styles}} className="devL"></div>

		  <div style={{transform:transformR, ...styles}} className="devR"></div>

		  <div style={{opacity:opacity, ...styles}}>
					<img src={addArticleIcon}   alt="search-icon" />
		  </div>

		</button>


	)

}
export default toggleDecorator(ToggleCreate)
